INSERT INTO `offers` (`id`, `main_cat`, `cat`, `store`, `typ`, `name`, `img`, `alt_tag`, `header`, `sub_header`, `credit_time`, `credit_money`, `url`, `status`, `summary`, `details`, `tag`, `indate`, `ldate`, `coupon`, `short_url`) VALUES
(1, 'Offer', '1', NULL, 'image', 'FLAT 20% Off on Medicines Rs.50 Cashback from PayBox', '1_netmeds.png', '', 'FLAT 20% Off on Medicines', 'Rs.50 Cashback from PayBox', '', 'Rs.50 Cashback', 'http://www.netmeds.com/?source_attribution=DMM-CPV&utm_source=DMM-CPV&utm_medium=CPV&utm_campaign=DMM-CPV1', '1', '<div style="text-align: justify;"><span style="font-size: 10pt;">Netmeds.com, India Ki Pharmacy, is India''s most trusted pharmacies. You can buy and send medicines from any corner of the country - with just a click of the mouse. Netmeds.com makes a wide range of prescription medicines and other health products conveniently available all across India. Just shop at netmeds.com via PayBox, place your order online and have your medicines delivered to you at your doorstep. That''s not all. Get the latest netmeds coupon codes and netmeds offers on PayBox. Also, get netmeds cashback when you shop at netmeds via PayBox.</span></div>', '<div style="text-align: justify;"><span style="font-size: 10pt;">Netmeds.com, India Ki Pharmacy, is brought to you by the Dadha &amp; Company - one of India''s most trusted pharmacies, with over 100 years'' experience in dispensing quality medicines. Netmeds.com helps you look after your own health effortlessly as well as take care of loved ones wherever they may reside in India. You can buy and send medicines from any corner of the country - with just a few clicks of the mouse. Netmeds.com makes a wide range of prescription medicines and other health products conveniently available all across India. Even second and third tier cities and rural villages can now have access to the latest medicines. Since they also offer generic alternatives to most medicines, online buyers can expect significant savings. With easy access to reliable drug information, you get to know all about your medicine at netmeds.com, and once you''re a Netmeds customer, you''ll get regular refill reminders, ensuring you''re never short of medicines. Just shop at netmeds.com via PayBox, place your order online and have your medicines delivered to you at your doorstep. That''s not all. Get the latest netmeds coupon codes and netmeds offers on PayBox. Also, get netmeds cashback when you shop at netmeds via PayBox.</span></div>', 'Netmeds offers,Cashback Offers, Online Medicine', '2017-01-17 09:08:23', '2017-02-24 05:42:21', NULL, NULL),
(2, 'Offer', '1', '25', 'image', 'Rs.100 CASHBACK On recharge of Rs.100', '2_paytm.png', 'PayTM Jan 2017 coupons codes, discount deals,', 'Rs.100 CASHBACK', 'On recharge of Rs.100', '', 'Rs.100 Cashback', 'https://paytm.com/?&utm_term=24211023f3abe8ed737a726538d142a3d1', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">It''s an \r\nexclusive and fantastic offer from Paytm, get Rs.100/- flat cashback on \r\nrecharge or payment of Rs.100/-. The minimum recharge amount should be \r\nRs.100/-. Use the given code to avail the offer. Code can be used \r\nfor&nbsp;mobile prepaid/postpaid, DTH, datacard recharge, landline &amp; \r\nbroadband transactions. Once your transaction completes, then you can \r\nuse the given code to avail Rs.10/- cashback for the next 10 months on \r\nyour recharges.</span></div>', '<div style="text-align: justify;"><span style="font-size: 10pt;">It''s an \r\nexclusive and fantastic offer from Paytm, get Rs.100/- flat cashback on \r\nrecharge or payment of Rs.100/-. The minimum recharge amount should be \r\nRs.100/-. Use the given code to avail the offer. Code can be used \r\nfor&nbsp;mobile prepaid/postpaid, DTH, datacard recharge, landline &amp; \r\nbroadband transactions. Once your transaction completes, then you can \r\nuse the given code to avail Rs.10/- cashback for the next 10 months on \r\nyour recharges. Not valid for Airtel numbers and code can be used once \r\nper user/number. Offer valid for limited time period and can be availed \r\non mobile app and website. Hurry and start transacting!</span></div>', 'Paytm Offers,Cashback Offers,Free Recharge', '2017-01-17 09:23:21', '2017-02-28 10:13:12', NULL, 'paytmcashback'),
(3, 'Offer', '2', '5', 'image', 'Get Rs.100 Cashback On Shopping Of Rs.1000 & Above', '3_5_amazon.jpeg', 'Amazon Jan 2017 coupons codes, discount deals', 'Get Rs.100 Cashback', 'On Shopping Of Rs.1000 & Above', '', 'Rs.100 Cashback', 'http://www.amazon.in/s?_encoding=UTF8&bbn=1968024031&camp=3626&creative=24790&fst=as%3Aoff&hidden-keywords=-sunglasses%2C -sunglass%2C -keychains%2C -aviators&linkCode=ur2&qid=1458554795&rh=n%3A1571271031%2Cn%3A!1571272031%2Cn%3A1968024031%2Cp_98%3A10440597031%2Cp_n_pct-off-with-tax%3A2665401031&rnid=2665398031', '0', '<div style="text-align: justify;"><span style="font-size: 13.3333px;">Fabulous\r\n Amazon India &nbsp;sale!! Get free Rs.100/- Gift card on shopping of \r\nRs.1000/- plus extra 6% cashback. Offer is valid on cooking essentials, \r\nfood, snacks, home supplies, baby products, skin care, personal care \r\n&amp; grooming and more. Once you shop for Rs.1000/- you will get a \r\nRs.100/- gift card which will be send your register email id. Offer is \r\nvalid on amazon India site &amp; app. Offer valid maximum once per user.\r\n Hurry!! Recharge it now. Limited period offer.</span></div>', '<div style="text-align: justify;"><span style="font-size: 13.3333px; font-family: Arial, Verdana;">Fabulous Amazon India &nbsp;sale!! Get free Rs.100/- Gift card on shopping of Rs.1000/- plus extra 6% cashback. Offer is valid on cooking essentials, food, snacks, home supplies, baby products, skin care, personal care &amp; grooming and more. Once you shop for Rs.1000/- you will get a Rs.100/- gift card which will be send your register email id. Offer is valid on amazon India site &amp; app. Offer valid maximum once per user. Hurry!! Recharge it now. Limited period offer.</span></div>', 'Amazon Offers,Cashback Offers,Online Shopping', '2017-01-17 09:46:49', '2017-02-28 10:12:37', NULL, 'amazongiftcard'),
(4, 'Offer', '2', '5', 'image', 'Rs.450 CASHBACK Shop & Get Rs.450 Cashback', '4_5_amazon.jpeg', 'Amazon Jan 2017 coupons codes, discount deals', 'Rs.450 CASHBACK', 'Shop & Get Rs.450 Cashback', '', 'Rs.450 Cashback', 'http://www.amazon.in/', '0', '<div style="text-align: justify;"><span style="color: rgb(48, 48, 48); font-size: 13.3333px;">Shop\r\n for all your needs from clothing to footwears, from computers to \r\nmobiles, personal care products, groceries, etc. at Amazon and get upto \r\nRs.450/- cashback in the form of Amazon pay balance on paying through \r\nAmazon Pay Balance. Cashback under this offer is 15% of the total \r\nbooking amount for prime users and 10%, for the non-prime users which \r\nare maximum upto Rs.450/- and Rs.300/- respectively. It is applicable on\r\n a minimum order amount of Rs.100/-. You can shop for products from \r\nvarious brands namely Philips, Motorola, Sony, Samsung, Airwick, \r\nAmbipur, Ariel, Cif, Closeup, Colin, Comfort, Dettol, and much more. No \r\ncoupon code is required to get the cashback. Shop now!!</span></div>', '<div style="text-align: justify;"><span style="font-size: 13.3333px; color: rgb(48, 48, 48); font-family: Arial, Verdana;">Shop for all your needs from clothing to footwears, from computers to mobiles, personal care products, groceries, etc. at Amazon and get upto Rs.450/- cashback in the form of Amazon pay balance on paying through Amazon Pay Balance. Cashback under this offer is 15% of the total booking amount for prime users and 10%, for the non-prime users which are maximum upto Rs.450/- and Rs.300/- respectively. It is applicable on a minimum order amount of Rs.100/-. You can shop for products from various brands namely Philips, Motorola, Sony, Samsung, Airwick, Ambipur, Ariel, Cif, Closeup, Colin, Comfort, Dettol, and much more. No coupon code is required to get the cashback. Shop now!!</span></div>', 'Cashback Offers,Mobikwik Offers, Mobikwik Cash', '2017-01-17 09:59:45', '2017-02-28 10:12:01', NULL, 'amazoncashback'),
(5, 'Offer', '2', '27', 'image', 'FLAT Rs.300 OFF On Order Of Rs.1500 & Above', '5_83 (2).jpg', 'Lenskart Jan 2017 coupons codes, discount dea', 'FLAT Rs.300 OFF', 'On Order Of Rs.1500 & Above', '', 'Rs.300 OFF', 'http://www.lenskart.com/?utm_source=vcommission', '0', '<div style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 13.3333px; color: rgb(48, 48, 48);">Grab\r\n Flat Rs.300/- off on order Rs.1500/- &amp; above. Lenskart.com brings \r\nto you an exciting range of trendy eyeglasses accessories, sunglasses \r\naccessories and contact lens cases in different hues and designs. No \r\ncoupon code and activate this offer. Hurry!! Place your order now. Offer\r\n is limited time only.</span></div>', '<div style="text-align: justify;"><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px; background-color: rgb(255, 255, 255);">Grab Flat Rs.300/- off on order Rs.1500/- &amp; above. Lenskart.com brings to you an exciting range of trendy eyeglasses accessories, sunglasses accessories and contact lens cases in different hues and designs. No coupon code and activate this offer. Hurry!! Place your order now. Offer is limited time only.</span></font></div>', 'Online Shopping,Lenskart Offers,Cashback Offers,', '2017-01-17 10:08:17', '2017-02-28 10:11:03', NULL, 'lenskartoffer'),
(6, 'Offer', '4', '21', 'image', 'Get Rs.150 Discount On First OLA Cab Ride', '6_21_8_ola.jpg', 'OLA Jan 2017 coupons codes, discount deals, p', 'Get Rs.150 Discount', 'On First OLA Cab Ride', '', 'Rs.150 Discount', 'https://www.olacabs.com/', '0', '<div style="text-align: justify;"><span style="font-size: 13.3333px; color: rgb(48, 48, 48);">Ola\r\n comes with an amazing offer, where you get a massive discount of \r\nRs.150/- on your first Ola Cab Ride. Offer is valid on Ola rides. \r\nApplicable only once per user or device or Ola account. Apply the above \r\nmentioned coupon code to avail this incredible offer. There is no \r\nminimum ride value to avail this offer. Hurry up and grab it now.</span></div><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px;"><br>No coupon code required for this offer.<br></span></font>', '<div style="text-align: justify;"><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px;">Ola comes with an amazing offer, where you get a massive discount of Rs.150/- on your first Ola Cab Ride. Offer is valid on Ola rides. Applicable only once per user or device or Ola account. Apply the above mentioned coupon code to avail this incredible offer. There is no minimum ride value to avail this offer. Hurry up and grab it now.<br><br></span></font><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px;">No coupon code required for this offer.</span></font><br></div>', 'Ola Offers,Discount Offers,Online Taxi Booking,', '2017-01-17 10:17:19', '2017-02-28 10:10:21', NULL, 'oladiscounts'),
(7, 'Offer', '4', '23', 'image', '30% Cashback on First Ride Book Uber cab through Helpchat app', '7_23_9_uber.png.jpg', 'UBER Jan 2017 coupons codes, discount deals, ', '30% Cashback on First Ride', 'Book Uber cab through Helpchat app', '', '30% CASHBACK', 'https://play.google.com/store/apps/details?id=com.ubercab&referrer=mat_click_id%3De8b3e8affdf3c6e9778d981ce9a3cf29-20170117-7336%26utm_campaign%3DDisplay-OptimiseMedia_77_IN-National_R_And_ACQ_CPFT_en-IN%26utm_content%3DInternal%26utm_medium%3DInternal%26utm_source%3DOptimise%2BMedia%2BGroup%2BLtd%26utm_term%3DInternal', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">Exclusive Uber offer! Book Uber cab through Helpchat app and get 30% cashback on your first ride. Offer is valid on minimum ride fare of Rs.50/-. Maximum cashback of Rs.30/- can be availed. Use the given code before booking your ride. Offer is valid twice per user. Valid only on bookings made through Helpchat app. Book your ride now!</span></div><br><a href="https://play.google.com/store/apps/details?id=com.ubercab&amp;referrer=mat_click_id%3De8b3e8affdf3c6e9778d981ce9a3cf29-20170117-7336%26utm_campaign%3DDisplay-OptimiseMedia_77_IN-National_R_And_ACQ_CPFT_en-IN%26utm_content%3DInternal%26utm_medium%3DInternal%26utm_source%3DOptimise%2BMedia%2BGroup%2BLtd%26utm_term%3DInternal">Download HelpChat Now</a>.<br>', '<div style="text-align: justify;"><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px;">Exclusive Uber offer! Book Uber cab through Helpchat app and get 30% cashback on your first ride. Offer is valid on minimum ride fare of Rs.50/-. Maximum cashback of Rs.30/- can be availed. Use the given code before booking your ride. Offer is valid twice per user. Valid only on bookings made through Helpchat app. Book your ride now!<br><br></span></font><br><br><a href="https://play.google.com/store/apps/details?id=com.ubercab&amp;referrer=mat_click_id%3De8b3e8affdf3c6e9778d981ce9a3cf29-20170117-7336%26utm