(101, 'Tricks', '6', '5', 'image', 'Buy Any Product @ Re.1. Solve The Clue On App to Get.', '5_amazon.jpeg', 'Amazon Jan 2017 coupons codes, discount deals', 'Buy Any Product @ Re.1.', 'Solve The Clue On App to Get.', '', 'Any Product At Rs.1/-', 'http://www.amazon.in/', '0', '<div style="text-align: justify;"><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px;">Amazon offers you to solve the clue on app to get all amazon products at Re.1/- only, you are just required to give answers of very simple questions asked on the amazon app. In case you are able to answer the questions correctly then you will be eligible to buy any amazon product at Re.1/-. This offer is valid only on Amazon app. <br></span></font></div>', '<div style="text-align: justify;"><span style="color: rgb(48, 48, 48); font-size: 13.3333px;">Amazon offers you to solve the clue on app to get all amazon products at Rs.1/- only, you are just required to give answers of very simple questions asked on the amazon app. In case you are able to answer the questions correctly then you will be eligible to buy any amazon product at Re.1/-. This offer is valid only on Amazon app. This offer not valid for the Amazon app on iphone 4 &amp; below, windows phones &amp; tablets. Shop now &amp; get surprises in a every 30 minutes. Hurry!! Shop now!! Offer is running soon.</span></div>', 'Cashback Offers,Mobikwik Offers,Amazon Offers,', '2017-02-28 11:52:55', '2017-02-28 11:52:55', NULL, 'amazontricks'),
(102, 'Tricks', '4', NULL, 'image', 'Flat 50% Instant Discount On Hotels Across India on MakeMyTrip', '33_mmtlogo.png', '', 'Flat 50% Instant Discount', 'On Hotels Across India on MakeMyTrip', '', 'FLAT 50% Discount', 'https://www.makemytrip.com/hotels?', '0', 'This offer is valid for hotel bookings made on www.makemytrip.com To avail the offer, Use coupon code to avail the offer. For Domestic hotels, the Instant Discount is 50% up to maximum of Rs. 1400. This offer is valid for hotel check outs till 31st January 2017. The discount will be provided on the base price.This offer is valid only on select hotels.Offer is not valid for Pay at Hotel bookings. A user can make upto 3 bookings per day and 5 bookings in 30 days using any offer code.This offer cannot be clubbed with any other offer of MakeMyTrip.<br><br>Use Coupon Code: MMTGO<br>', 'This offer is valid for hotel bookings made on www.makemytrip.com To avail the offer, Use coupon code to avail the offer. For Domestic hotels, the Instant Discount is 50% up to maximum of Rs. 1400. This offer is valid for hotel check outs till 31st January 2017. The discount will be provided on the base price.This offer is valid only on select hotels.Offer is not valid for Pay at Hotel bookings. A user can make upto 3 bookings per day and 5 bookings in 30 days using any offer code.This offer cannot be clubbed with any other offer of MakeMyTrip.<br><br>Use Coupon Code: MMTGO<br>', 'Online Hotel Booking,Discount Offers,MakeMyTrip Offers', '2017-02-28 11:53:41', '2017-02-28 11:53:41', 'MMTGO', 'makemytriptricks'),
(106, 'Tricks', '2', '18', 'image', 'Get 75% Off on All Products Clothing, Bags, Accessories, etc.', '32_18_flip.png', 'Flipkart Jan 2017 coupons codes, discount dea', 'Get 75% Off on All Products', 'Clothing, Bags, Accessories, etc.', '', '75% OFF SALE', 'https://www.flipkart.com/all/~75-off-store/pr?affid=nkumarzout&sid=all&affExtParam1=flat75%25off', '0', '<div style="text-align: justify;"><span style="font-size: 13.3333px; font-family: Arial, Verdana;">Flipkart offers you amazing discount on various products. Grab these products at flat 75% off, with the price of the products already being slashed! Choose your products from categories like clothing, mobile accessories, home & kitchen, watches, bags, furniture and many more. Some of the products also have bank offers associated with them. Start shopping right now and grab all your loved products at lowest of prices!<br></span></div>', '<div style="text-align: justify;"><span style="font-size: 13.3333px; font-family: Arial, Verdana;">Flipkart offers you amazing discount on various products. Grab these products at flat 75% off, with the price of the products already being slashed! Choose your products from categories like clothing, mobile accessories, home & kitchen, watches, bags, furniture and many more. Some of the products also have bank offers associated with them. Start shopping right now and grab all your loved products at lowest of prices!<br><br></span></div>', 'Flipkart Offers,Cashback Offers,Flipkart Loot', '2017-02-28 11:55:06', '2017-02-28 11:55:06', NULL, 'flipkarttricks'),
(107, 'Tricks', '5', NULL, 'image', 'Get Upto Rs 15 Cashback On Recharge of Rs 50 and above', '30_rech.jpg', '', 'Get Upto Rs 15 Cashback', 'On Recharge of Rs 50 and above', '', 'Rs.15 Cashback', 'https://www.rechargeadda.com/cdcbackoffer?', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">Get Rs 15 Cashback on minimum recharge of Rs 50. This Offer is valid only for newly registered users on their first 3 mobile recharges, each carrying Rs 5 Cashback. This Cashbcak will be Credited in the recharge ADDA Cashback account only on Successful transaction. Click to Recharge it Now. Hurry</span></div><br>Use Coupon : CABNEW<br>', '<div style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; text-align: justify;"><span style="font-size: 10pt;">Get Rs 15 Cashback on minimum recharge of Rs 50. This Offer is valid only for newly registered users on their first 3 mobile recharges, each carrying Rs 5 Cashback. This Cashbcak will be Credited in the recharge ADDA Cashback account only on Successful transaction. Click to Recharge it Now. Hurry.</span></div><div style="text-align: justify;"><font face="Arial, Verdana"><span style="font-size: 13.3333px;"><br></span></font></div><font face="Arial, Verdana"><span style="font-size: 10pt;">Use Coupon : CABNEW</span></font><br>', 'Free Recharge,RechargeAdda,Online Recharge', '2017-02-28 12:04:10', '2017-02-28 12:04:10', 'CABNEW', 'rechargetricks'),
(108, 'Tricks', '4', '22', 'image', 'Rs.75 CASHBACK On Payment Through Freecharge Wallet', '29_22_14_Redbus_logo-23.jpg', 'Redbus Jan 2017 coupons codes, discount deals', 'Rs.75 CASHBACK', 'On Payment Through Freecharge Wallet', '', 'Rs.75 Cashback', 'https://www.redbus.in/info/OfferTerms#FREECHARGE_OFFER', '0', '<span style="font-family: Arial, Verdana; font-size: 13.3333px; text-align: justify;">Pay on Redbus through Freecharge wallet and get Rs.75 Cashback Offer valid once per user. Offer valid across India.<br></span>', '<div style="text-align: justify;"><span style="font-family: Arial, Verdana; font-size: 13.3333px; text-align: justify;">Pay on Redbus through Freecharge wallet and get Rs.75 Cashback Offer valid once per user. Offer valid across India.</span></div>', 'Redbus Offers,Cashback Offers,FreeCharge Offers,', '2017-02-28 12:04:31', '2017-02-28 12:04:31', NULL, 'redbustricks'),
(109, 'Tricks', '2', '19', 'image', 'UPTO 80% OFF Upto 80% Off On Home & Kitchen Products', '28_19_15_shopclues_logo.jpg', 'Shopclues Jan 2017 coupons codes, discount de', 'UPTO 80% OFF', 'Upto 80% Off On Home & Kitchen Products', '', '80% OFF SALE', 'http://www.shopclues.com/electronics-crazy-deals.html?', '0', '<div style="text-align: justify;"><span style="font-size: 13.3333px; font-family: Arial, Verdana;">Now Get Upto 80% Off On Home &amp; Kitchen Products On This Mega Home Sale. Products Like Cookers, Home Furnishing Products &amp; More To Choose. Check The Landing Page For More Details.</span></div>', '<span style="font-size: 13.3333px; text-align: justify;">Now Get Upto 80% Off On Home &amp; Kitchen Products On This Mega Home Sale. Products Like Cookers, Home Furnishing Products &amp; More To Choose. Check The Landing Page For More Details.</span>', 'Discount Offers,Shopclues Offer,Discounts', '2017-02-28 12:05:05', '2017-02-28 12:05:05', NULL, 'shopcluestricks'),
(110, 'Tricks', '4', '23', 'image', 'FLAT Rs 150 Off On Ride All Across India', '25_9_uber.png.jpg', 'UBER Jan 2017 coupons codes, discount deals, ', 'FLAT Rs 150 Off On Ride', 'All Across India', '', 'Rs.150 Off', 'https://play.google.com/store/apps/details?id=com.ubercab&referrer=mat_click_id%3Dbb641ea24592f5f27de89b76f1061257-20170117-7336%26utm_campaign%3DDisplay-Grabon_77_IN-National_R_And_ACQ_CPFT_en-IN%26utm_content%3DInternal%26utm_medium%3DInternal%26utm_source%3DGrabon%26utm_term%3DInternal', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">Book your Uber ride today and enjoy Rs.50 discount on your first 3 rides. This is Valid across India. Avail a maximum discount of Rs.150 for 3 Rides. Ride in style plus at affordable price range with Uber cabs. Book today!</span></div>', '<div style="text-align: justify;"><span style="font-size: 10pt;">Book your Uber ride today and enjoy Rs.50 discount on your first 3 \r\nrides. This is Valid across India. Avail a maximum discount of Rs.150 \r\nfor 3 Rides. Ride in style plus at affordable price range with Uber \r\ncabs. Book today!</span></div><br>Steps to Redeem:<br><br>1. Download the Uber app in Mobile and signup<br><br>2. Select ''Promotions'' tab<br><br>3. Enter the code - ''GRAB50'' and click on ''Apply''<br><br>4. Now, you can enjoy Rs 50 discount on your first 3 rides.', 'Uber Offer,Discount Offers,Online Taxi Booking', '2017-02-28 12:05:39', '2017-02-28 12:05:39', 'GRAB50', 'ubertricks'),
(111, 'Tricks', '1', '16', 'image', 'Add Cash & Get Free 5% Cashback Only on FreeCharge App', '21_free.jpg', 'Freecharge Jan 2017 coupons codes, discount d', 'Add Cash & Get Free 5% Cashback', 'Only on FreeCharge App', '', 'Cashback Offer', 'https://play.google.com/store/apps/details?id=com.freecharge.android&hl=en', '0', '1. Download &amp; Install Freecharge app from playstore <br><br>2. Login/Signup account on Freecharge<br><br>3. Click on “Add Money” option<br><br>4. Then Enter Amount to add – Min. Rs.50', '1. Download &amp; Install Freecharge app from playstore <br><br>2. Login/Signup account on Freecharge<br><br>3. Click on “Add Money” option<br><br>4. Then Enter Amount to add – Min. Rs.50<br><br>5. On next page, Apply Promo code : WALLET<br><br>6. After applying Promo code, Complete the Payment using Debit/Credit card<br><br>7. You will get cashback within 24 Hrs<br><br>8. Enjoy!!', 'FreeCharge Offers,Cashback Offers,Free Cashback', '2017-02-28 12:06:05', '2017-02-28 12:06:05', 'WALLET', 'freechargetricks'),
(113, 'Tricks', '5', NULL, 'image', 'Refer & Earn Rs.100 Free Real Cash Loot', '16_ScreenShot010.jpg', '', 'Refer & Earn Rs.100', 'Free Real Cash Loot', '', 'Rs.100 Free Recharge', 'https://play.google.com/store/apps/details?id=in.chillr&referrer=', '0', 'Biggest Loot came again of Chillr App. Just You have to Signup in Chillr\r\n app &amp; Transact from your Chillr account and start referring \r\nfriends. So Just Do this offer. It’s available till 26th January 2017. \r\nSo Loot Now Before the Expiry time. Hurry Up!!<br><br>Download Chillr App From Playstore<br><br>Install and open the app<br>', 'Biggest Loot came again of Chillr App. Just You have to Signup in Chillr app &amp; Transact from your Chillr account and start referring friends. So Just Do this offer. It’s available till 26th January 2017. So Loot Now Before the Expiry time. Hurry Up!!<br><br>Download Chillr App From Playstore<br>Install and open the app<br>Click on Next to Skip Intro’s<br>If you don’t know How to Generate MPIN – Click Here<br>Enter your Mobile No. which is Registered with Bank account (Make Sure Mobile No. Inserted in your Mobile)<br>It will Fetch OTP automatically<br>Now Fill the required Details<br>Apply refer code – 4ADGG6OCI<br>Now Perform any Transaction such as Recharge/Bill Payments<br>If you Dont want to Spend Rs.10 then Send Rs.1 to any Registered Chillr Mobile No<br>', 'Free Recharge Offer, Refer & Earn,App Download Offer', '2017-02-28 12:06:38', '2017-02-28 12:06:38', NULL, 'chillrtricks'),
(115, 'Tricks', '5', NULL, 'image', 'Qzaap App Loot Earn Paytm Cash By Referring Your Friends', '14_ScreenShot007.jpg', '', 'Qzaap App Loot', 'Earn Paytm Cash By Referring Your Friends', '', 'Free PayTM Cash', 'https://play.google.com/store/apps/details?id=com.qzaap&hl=en', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">Qzaap app is offering 2500 points on signup + refer &amp; earn program \r\ntoo with which you can earn paytm money. Minimum amount required to \r\nredeem paytm money is 10k points so refer 3 friends to qzaap and redeem \r\nPaytm. This app also conducts the quiz. For each question you will get 5\r\n points and if the answer is wrong then -5 points. I also suggest you to\r\n play quiz which is really fun with simple questions.</span></div>', '<div style="text-align: justify;"><span style="font-size: 10pt;">Qzaap app is offering 2500 points on signup + refer &amp; earn program too with which you can earn paytm money. Minimum amount required to redeem paytm money is 10k points so refer 3 friends to qzaap and redeem Paytm. This app also conducts the quiz. For each question you will get 5 points and if the answer is wrong then -5 points. I also suggest you to play quiz which is really fun with simple questions.</span></div><br>First of all download the qzaap app from Here<br>Now install &amp; open the qzaap app.<br>Now you will see two options Facebook &amp; Google. Simply choose one for registration.<br>After registration it will ask for Refer code. Enter this code “YGSNF4”<br>Must enter refer code to get 2500 points as joining bonus.<br>After entering above refer code you will get 2500 points as joining bonus<br>That’s it. You have successfully looted 2500 as joining bonus and refer &amp; earn for more.<br>', 'Qzaap App Loot, Free Paytm Cash, Refer & Earn', '2017-02-28 12:07:09', '2017-02-28 12:07:09', 'YGSNF4', 'qzaaptricks'),
(117, 'Tricks', '4', NULL, 'image', 'Instant Rs.34 Free Recharge On SignUp Every Number', '11_ScreenShot005.jpg', '', 'Instant Rs.34 Free Recharge', 'On SignUp Every Number', '', 'Rs.34 Free Recharge', 'https://play.google.com/store/apps/details?id=com.balancehero.truebalance&hl=en', '0', '<div style="text-align: justify;"><span style="font-size: 10pt;">Truebalance App –&nbsp; The wait is finally over! They have just launched \r\napp’s latest version v2.27.03 where you can choose to recharge other \r\nmobile numbers from your account in True Balance App! You no longer have\r\n to turn on other apps to top up for your loves ones.</span></div>', '<div style="text-align: justify;"><span style="font-size: 10pt;">Truebalance App –&nbsp; The wait is finally over! They have just launched app’s latest version v2.27.03 where you can choose to recharge other mobile numbers from your account in True Balance App! You no longer have to turn on other apps to top up for your loves ones.</span></div><br>1 ) First Download TrueBalance app <br><br>2) After That Allow all Permissions which App required.<br><br>3) Now Sign up a New Account and enter your details.<br><br>4) If It Asks For Invitation Link Then Put This – http://m.truebalance.in/v2/app?code=2Z4VWEUW<br><br>5) Verify your mobile number.<br><br>6) Enable TrueBalance app and Enter your cellular Plans.<br><br>7) Voila! You Got Free Rs.10 In your wallet and free Rs.10 as Emergency Loan= Rs.20 Direct SignUp', 'True Balance,Free Recharge Offer,Signup Offer', '2017-02-28 12:07:43', '2017-02-28 12:07:43', '2Z4VWEUW', 'truebalancetricks'),
(119, 'Tricks', '2', '27', 'image', 'FLAT Rs.300 OFF On Order Of Rs.1500 & Above', '5_83 (2).jpg', 'Lenskart Jan 2017 coupons codes, discount dea', 'FLAT Rs.300 OFF', 'On Order Of Rs.1500 & Above', '', 'Rs.300 OFF', 'http://www.lenskart.com/?utm_source=vcommission', '0', '<div style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 13.3333px; color: rgb(48, 48, 48);">Grab\r\n Flat Rs.300/- off on order Rs.1500/- &amp; above. Lenskart.com brings \r\nto you an exciting range of trendy eyeglasses accessories, sunglasses \r\naccessories and contact lens cases in different hues and designs. No \r\ncoupon code and activate this offer. Hurry!! Place your order now. Offer\r\n is limited time only.</span></div>', '<div style="text-align: justify;"><font color="#303030" face="Arial, Verdana"><span style="font-size: 13.3333px; background-color: rgb(255, 255, 255);">Grab Flat Rs.300/- off on order Rs.1500/- &amp; above. Lenskart.com brings to you an exciting range of trendy eyeglasses accessories, sunglasses accessories and contact lens cases in different hues and designs. No coupon code and activate this offer. Hurry!! Place your order now. Offer is limited time only.</span></font></div>', 'Online Shopping,Lenskart Offers,Cashback Offers,', '2017-02-28 12:08:07', '2017-02-28 12:08:07', NULL, 'lenskarttricks');
